class Solution {
public:
    int maxOperations(string s) {
        int ret = 0;
        int count = 0;
        char last = '0';
        for (char c: s) {
            if (c == '1') count++;
            else if (last != '0'){
                ret += count;
            }
            last = c;
        }
        return ret;

    }
};
